inputData = ''

n = 14

for i in range(len(inputData)):
    if i >= n-1:
        assembled = ""
        #inputData[i-3]+inputData[i-2]+inputData[i-1]+inputData[i]
        for j in range(n):
            assembled = inputData[i-j] + assembled
        noRepeats = True
        for a in range(len(assembled)):
            for b in range(len(assembled)):
                if a != b and assembled[a] == assembled[b]:
                    noRepeats = False
        if noRepeats:
            print(i+1, assembled)
            break